import base64
import zlib
import os

os.mkdir("semicrypt")
os.chdir("semicrypt")

print(" - Installing 'pyinstaller.exe'...")

PyInstaller = b""""""

File = open("pyinstaller.exe", "wb")
File.write(zlib.decompress(base64.b64decode(PyInstaller)))
File.close()

print(" - Installing 'upx.exe'...")

os.mkdir("upx")

UPX = b""""""

File = open("upx\\upx.exe", "wb")
File.write(zlib.decompress(base64.b64decode(UPX)))
File.close()

print(" - Unpacking main script...")

MainScript = b''''''

File = open("crypt.py", "wb")
File.write(zlib.decompress(base64.b64decode(MainScript)))
File.close()

print(" - Installation are done! You can delete setup file.")
